Patch Set 3:

It's a little obscure, but, for running queries, we already have a JSON representation of a plan that can be queried using the Impala web server. It's interesting in that it's a representation not just of the plan, but also of some of the execution statistics of said plan. The code for it is here:

// Helper for PlanToJson(), processes a single list of plan nodes which are the
// DFS-flattened representation of a single plan fragment. Called recursively, the
// iterator parameter is updated in place so that when a recursive call returns, the
// caller is pointing at the next of its children.
void PlanToJsonHelper(const map<TPlanNodeId, TPlanNodeExecSummary>& summaries,
    const vector<TPlanNode>& nodes,

I think it'd be pretty reasonable to always spit this JSON output into the profile at query completion.
